document.addEventListener('DOMContentLoaded', function() {
    // Función para descargar el pedido como PDF
    function downloadOrderPDF(order) {
        const { jsPDF } = window.jspdf; // Asegurarnos de que jsPDF está disponible
        const doc = new jsPDF();

        const marginLeft = 14;
        let y = 22;

        // Logo
        const logoBase64 = 'data:image/png;base64,'; 
        const textBlockWidth = 100; 
        const logoX = marginLeft + textBlockWidth + 30;  
        const logoY = 10; 
        doc.addImage(logoBase64, 'PNG', logoX, logoY, 55, 0)

        // Información del pedido
        doc.setFontSize(16);
        doc.setFont("helvetica", "bold");
        doc.text(`Número de Pedido: ${order.id}`, marginLeft, y);
        y += 10;

        
        // Título
        doc.setFontSize(22);
        doc.text('Detalles del Pedido', marginLeft, y);
        y += 10

        // Información del cliente
        doc.setFontSize(14);
        doc.text("Cliente:", marginLeft, y);
        doc.setFont("helvetica", "normal");
        doc.text(`${order.customer.name} (${order.customer.storeName})`, marginLeft + 35, y);
        y += 6;
        doc.setFont("helvetica", "bold");
        doc.text("Zona:", marginLeft, y);
        doc.setFont("helvetica", "normal");
        doc.text(`${order.customer.zone}`, marginLeft + 35, y);
        y += 6;
        doc.setFont("helvetica", "bold");
        doc.text("Dirección:", marginLeft, y);
        doc.setFont("helvetica", "normal");
        doc.text(`${order.customer.address}`, marginLeft + 35, y);
        y += 6;
        doc.setFont("helvetica", "bold");
        doc.text("Teléfono:", marginLeft, y);
        doc.setFont("helvetica", "normal");
        doc.text(`${order.customer.phone}`, marginLeft + 35, y);
        y += 6;
        doc.setFont("helvetica", "bold");
        doc.text("Email:", marginLeft, y);
        doc.setFont("helvetica", "normal");
        doc.text(`${order.customer.email}`, marginLeft + 35, y);
        y += 10;

        // Línea separadora
        doc.line(marginLeft, y, 200, y);
        y += 10;


         // Crear la tabla
         doc.setFontSize(12)
         doc.setFont("helvetica", "bold");
         doc.text("Código", marginLeft, y);
         doc.text("Descripción", marginLeft + 43, y);
         doc.text("Cant", marginLeft + 98, y);
         doc.text("Desc (%)", marginLeft + 112, y);
         doc.text("Precio s/IVA", marginLeft + 133, y);
         doc.text("Total s/IVA", marginLeft + 161, y);
         y += 6;

        // Contenido de la tabla
        doc.setFont("helvetica", "normal");
        order.cart.forEach((item) => {
            const totalWithoutIVA = item.precioUnitario * item.unidades;
            // Limite de caracteres
            const maxWidthDescription = 50;
            const descripcionDividida = doc.splitTextToSize(item.descripcion, maxWidthDescription);
            const maxWidth=50

            doc.text(item.codigo, marginLeft, y);
            doc.text(descripcionDividida, marginLeft + 43, y, {maxWidth});
            doc.text(`${item.unidades}`, marginLeft + 98, y);
            doc.text(`${item.descuento || 0}`, marginLeft + 112, y);
            doc.text(`$${item.precioUnitario.toFixed(2)}`, marginLeft + 133, y);
            doc.text(`$${totalWithoutIVA.toFixed(2)}`, marginLeft + 161, y);
            y += (descripcionDividida.length * 5);

            // Dibujar línea
            doc.setLineDash([1, 1], 0);  
            doc.line(marginLeft, y, 200, y);  
            y += 6; 

            // Si se llena la pagina agrega otra
            if (y > 270) {  
                doc.addPage('');
                y = 22;  
            }
        });

        y += 10;
        doc.line(marginLeft, y, 200, y);
        y += 10;

        // Totales
        const subTotal = order.cart.reduce((sum, item) => sum + item.precioUnitario * item.unidades, 0);
        const iva = subTotal * 0.21;
        const total = subTotal + iva;

        doc.setFont("helvetica", "bold");
        doc.text(`Subtotal: $${subTotal.toFixed(2)}`, marginLeft, y);
        y += 6;
        doc.text(`IVA (21%): $${iva.toFixed(2)}`, marginLeft, y);
        y += 6;
        doc.text(`Total: $${total.toFixed(2)}`, marginLeft, y);
        y += 10;

        // Nota final
        doc.setFont("helvetica", "italic");
        doc.text('*Este documento no es válido como factura', marginLeft, y + 10);

        // Descargar el PDF
        doc.save(`Detalle_de_pedido_#${order.id}.pdf`);
        
        
    }

    // Exponer la función para que pueda ser llamada desde otros archivos
    window.downloadOrderPDF = downloadOrderPDF;
});
